import React from 'react';
import axios from 'axios';

function httpcall(){
  axios.get("http://localhost:8080/todo").then(function(res){
    console.log(res.data.errors);
    return res.data.data;
  });
}

function Data({title}){
return <h1>title : {title}</h1>
}

function App() {
  var data = [];
  data = httpcall();
  console.log(data);
  return (
    <div className="App">
      <h1>Hello</h1>
      {data.map(ti => <Data title={ti.title}/>)}
    </div>
  );
}

export default App;
